  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Eastern
  Virginia Rivers Complex outlines Refuge accomplishments during the 2007 calendar
  year. Land acquisition is covered. The report includes a planning section which
  discusses public participation, compliance with environmental and cultural resource
  mandates, and research and investigations. Refuge administration is outlined; information
  about personnel and volunteer programs is given. Habitat management is also covered;
  subjects include fire management. The wildlife section of the report discusses endangered
  and threatened species and raptors. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, and law enforcement. The
  equipment and facilities section of the report provides information about rehabilitation
  and major maintenance. Cooperative programs are provided at the end.\",\n\t\"owner_org\":
